import React from 'react'

//Icons from font Awesome
import * as FaIcons from "react-icons/fa";

import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <>

        <div className="navbar">

            <Link to="#" className='menu-bars'>
                <FaIcons.FaBars/>

            </Link>

        </div>

    </>
  )
}

export default Navbar
